import instance from "./actions/api";
import {clientsContentDataSuccess} from "./actions/clientsAC";

 const clientsContentData =  (url) => async dispatch => {
    const res = await instance.get(url)
    dispatch(clientsContentDataSuccess(res.data))
}
export default clientsContentData
